using System;
using System.Text;
using CommandSystem;

namespace _Scripts.CommandSystem.Commands.Console
{
	[CommandHandler(typeof(GameConsoleCommandHandler))]
	public class PrrCommand : ICommand, IHiddenCommand
	{
		public string Command { get; } = "prr";

		public string[] Aliases { get; } = new string[0];

		public string Description { get; } = "TcpConsole buffers debug command";

		public bool Execute(ArraySegment<string> arguments, ICommandSender sender, out string response)
		{
			if (!sender.CheckPermission(PlayerPermissions.ServerConsoleCommands, out response))
			{
				return false;
			}
			if (arguments.Count == 0)
			{
				response = "Syntax error: prr <long/flood>";
				return false;
			}
			ServerLogs.AddLog(ServerLogs.Modules.Administrative, sender.LogName + " used LocalAdmin debug flood command.", ServerLogs.ServerLogType.RemoteAdminActivity_Misc, false);
			string text = arguments.At(0).ToLowerInvariant();
			if (!(text == "long"))
			{
				if (!(text == "flood"))
				{
					response = "Syntax error: prr <long/flood>";
					return false;
				}
				uint num;
				if (arguments.Count == 2 && uint.TryParse(arguments.At(1), out num))
				{
					int num2 = 0;
					while ((long)num2 < (long)((ulong)num))
					{
						ServerConsole.AddLog(string.Format("Flood message #{0}.", num2), ConsoleColor.Gray, false);
						num2++;
					}
					response = "Printed";
					return true;
				}
				response = "Syntax error: prr flood <amount of messages>";
				return false;
			}
			else
			{
				ulong num3;
				if (arguments.Count != 2 || !ulong.TryParse(arguments.At(1), out num3))
				{
					response = "Syntax error: prr long <length>";
					return false;
				}
				num3 /= 10000UL;
				if (num3 == 0UL)
				{
					response = "Syntax error: too small length";
					return false;
				}
				StringBuilder stringBuilder = new StringBuilder();
				for (ulong num4 = 0UL; num4 < num3; num4 += 1UL)
				{
					stringBuilder.Append("");
				}
				ServerConsole.AddLog(stringBuilder.ToString(), ConsoleColor.Gray, false);
				response = "Printed";
				return true;
			}
		}
	}
}
